import styles from "./FooterItem.module.css";

const FooterItem = ({ footerItem }) => {
  return (
    <>
      <li className={`px-1 ${styles["item"]}`}>
        <a href="#">{footerItem}</a>
      </li>
    </>
  );
};

export default FooterItem;
